import React from 'react'
import ReactDOM from 'react-dom'
import NavBar from './components/Navbar'

const App=()=> {

    return(
        <div className='container'>
            <NavBar/>
        </div>
    )
}

ReactDOM.render(<App/>,document.getElementById('root'));
